import React from 'react';

const styles={
    h1: {
        marginTop: '25vh',
        color: 'lightgrey',
    },
    button: {
        color: 'grey',
        padding: '1%',
        backgroundColor: 'inherit',
        borderColor: 'grey'
    }
}

const Newlanding = () => {

    return(

        <>
        <br></br>        
        <center>
            <h1 style={styles.h1}>Chase Lipscomb Web Developer</h1>
            <button style={styles.button}>View Work</button>
            </center>
        </>

    )
}
export default Newlanding
